    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to

document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

:root {
--color-primary: #95b540;
--color-primary-light: #E9F2D1;
--color-primary-lighter: #f6f9ec;
--color-primary-dark: #96b43f;
--color-border: #e8e8e8;
--color-text: #424949;
--color-code-bg: #f9f9f9;
--color-code-inline: #ff665d;
--color-boxy-bg: #fbfcfc;
--font-base: 'Source Sans Pro';
--font-highlight: 'Source Sans Pro';
--font-code: 'JetBrains Mono';
}


body, p, h1, h2, h3, h4, h5, h6,
.remark-slide-content, .remark-slide-content body,
.remark-slide-content p, .remark-slide-content h1,
.remark-slide-content h2, .remark-slide-content h3,
.remark-slide-content h4, .remark-slide-content h5,
.remark-slide-content h6 {
font-family: var(--font-base, 'Roboto', 'DIN', 'Helvetica', sans-serif);
color: var(--color-text);
font-weight: 400;
font-size: 20px;
}

h1, h2, .remark-slide-content h1, .remark-slide-content h2 {
font-family: var(--font-highlight, 'Roboto', 'DIN', 'Helvetica', sans-serif);
color: var(--color-text);
font-weight: 600;
letter-spacing: 0.02rem;
}
h1, .remark-slide-content h1 {
font-size: 1.802rem;
color: var(--color-text);
margin-top: 0.9rem;
margin-bottom: 0.8rem;
}
h2, .remark-slide-content h2 {
font-size: 1.602rem;
color: var(--color-text);
margin-top: 0.2rem;
margin-bottom: 0.6rem;


}
h3, .remark-slide-content h3 {
font-size: 1.424rem;
margin-top: 0.6rem;
margin-bottom: 0.4rem;
}
h4, .remark-slide-content h4 {
font-size: 1.266rem;
margin-top: 0.5rem;
margin-bottom: 0.3rem;
}
h5, .remark-slide-content h5 {
font-size: 1.266rem;
margin-top: 0.5rem;
margin-bottom: 0.3rem;
}
h6, .remark-slide-content h6 {
font-size: 1.125rem;
margin-top: 0.5rem;
margin-bottom: 0.3rem;
}

.remark-code, .remark-inline-code, pre, code {
font-family: var(--font-code);
font-size: 1.1rem !important;
}

.remark-code {
-webkit-border-radius: 2px;
-moz-border-radius: 2px;
border-radius: 2px;
}

.remark-inline-code {
background: var(--color-code-bg);
border: 1px solid var(--color-border);
border-radius: 3px;
margin-right: 2px;
padding: 2px 3px 1px;
color: var(--color-code-inline);
}

.largest { font-size: 2.488rem !important; }
.larger { font-size: 2.074rem !important; }
.large { font-size: 1.44rem; !important}
.small { font-size: 0.833rem !important; }
.smaller { font-size: 0.694rem !important; }
.smallest{ font-size: 0.579rem !important; }
.highlight {color: var(--color-primary);}
.altcol {color: #a8b0bb;}
.cite {
display: inline;
font-size: 0.7rem;
font-weight: 600;
padding: 1px 4px;
background-color: #b3cde3;
color: white;
border-radius: 4px;
text-align: center;
vertical-align: middle;
transition-duration: 0.3s;
}
.cite a, .cite a:hover {
color: white;
}
.cite:before {
content: '\f02e';
font-family: "Font Awesome 5 Free";
margin-right: 4px;
font-size: 0.5rem;
font-weight: 900;
}
.cite:hover {
opacity: 0.8;
text-align: center;
vertical-align: middle;
transition-duration: 0.3s;
}
.tool {
display: inline;
font-size: 0.7rem;
font-weight: 600;
padding: 1px 4px;
background-color: #decbe4;
color: white;
border-radius: 4px;
text-align: center;
vertical-align: middle;
transition-duration: 0.3s;
}
.tool a, .tool a:hover {
color: white;
}
.tool:before {
content: '\f1b2';
font-family: "Font Awesome 5 Free";
margin-right: 4px;
font-size: 0.5rem;
font-weight: 900;
}
.tool:hover {
opacity: 0.8;
text-align: center;
vertical-align: middle;
transition-duration: 0.3s;
}
.references li, .references p {
font-size: 60%;
}

.spaced {
line-height: 150%;
}

.end-text {
opacity: 0.6;
position: fixed;
bottom: 2rem;
line-height: 1rem;
}

blockquote {
border-left: 5px solid var(--color-primary);
display: inline-block;
background: var(--color-code-bg);
padding: 0.01rem;
padding-left: 0.6rem;
padding-right: 0.7rem;
border-radius: 4px 4px 4px 4px;
margin: 0;
}

a {
color: var(--color-primary);
text-decoration: none;
}
a:hover {
color: var(--color-primary);
opacity: 0.6;
text-decoration: underline;
}
.hljs-github .hljs-string, .hljs-github .hljs-doctag {
color: var(--color-code-inline);
}

.kbd {
background-color: var(--color-text);
color: white;
padding: 2px 5px;
border-radius: 4px;
font-size: 75%;
font-weight: 600;
letter-spacing: 0.04rem;
margin: 0em 0.05rem;
font-family: var(--font-code);
text-align: center;
}


.remark-slide-content {
padding-top: 1.8rem;
padding-left: 2.5rem;
padding-right: 2.5rem;
padding-bottom: 2rem;
}

ul {
margin-top: 0.8rem;
margin-bottom: 0.8rem;
}

pre {
margin-top: 0.8rem;
margin-bottom: 0.8rem;
}

p {
margin-top: 0.8rem;
margin-bottom: 0.8rem;
